import React, { useState } from 'react';
import classes from './MyModalNavigation.module.css';
import logo from '../../UI/icons/nicedunkslogo.png';

const MyModalNavigation = ({ visible, setVisible }) => {
  const rootClasses = [classes.myModalNavigation];
  const [activeMenu, setActiveMenu] = useState('');

  const toggleMenu = (menuId) => {
    setActiveMenu((prevState) => (prevState === menuId ? '' : menuId));
  };

  const handleClick = () => {
    setVisible(false);
  };

  if (visible) {
    rootClasses.push(classes.active);
  }

  const menuItems = [
    { label: 'НОВЫЕ ПОСТУПЛЕНИЯ' },
    { label: 'Б/У КРОССОВКИ', color: '#AC8BD5' },
    { label: 'АКСЕССУАРЫ' },
    { label: 'ОДЕЖДА' },
    { label: 'БРЕНДЫ' },
    { label: 'ПРЕДЗАКАЗ', color: '#AC8BD5' },
    { label: 'НОВЫЕ КРОССОВКИ' },
  ];

  const accordionItems = [
    {
      label: 'ДОСТАВКА И ОПЛАТА',
      content: `Самовывоз в городе Москва в районе метро Ботанический Сад
      Курьерская доставка по Москве осуществляется сервисами: Яндекс Go и Достависта
      Доставка по России и СНГ осуществляется почтовыми службами: Сдэк, Почта РФ и Boxberry
      Стоимость доставки рассчитывается отдельно
      Доставка по миру осуществляется курьерской службой EMS Почта России
      Стоимость доставки рассчитывается отдельно`,
    },
    {
      label: 'КОНТАКТЫ',
      content: `ПОЗИЦИИ ПОД ЗАКАЗ: https://t.me/NiceDunksOrder
      личный аккаунт в инстаграме: https://www.instagram.com/_goba_/
      основная страница в вк: https://vk.com/nicedunks
      мой профиль на авито: https://www.avito.ru/user/c560662529d1530f9fab8dd500a9934e/profile?src=sharing
      аккаунт для продаж в инстаграмме: https://instagram.com/donalddunks/
      менеджер по предзаказам: https://t.me/NiceDunksManager`,
    },
    {
      label: 'ВОПРОС - ОТВЕТ',
      content: `Все ваши товары оригинал? Да, у нас строго оригинальная продукция. Каждый товар проходит индивидуальную проверку.
      Какие у вас гарантии? Более тысячи положительных отзывов с 2017 года в профиле вк и авито.
      Как быстро приходит товар по предзаказу? Сроки доставки товаров по предзаказу составляют 14-21 день. Возможна экспресс доставка.
      Что делать, если желаемого товара нет на сайте? Если интересующей позиции нет на сайте, она доступна по предзаказу. Обращайтесь по предзаказу к нашему менеджеру.`,
    },
    {
      label: 'ТЕЛЕГРАММ КАНАЛ',
      content: `В моём телеграм канале вы сможете одними из первых узнавать не только о новых релизах, но и последних новостях из сникер - индустрии.
      Также в канале вы найдёте некоторые позиции, которых нет на сайте и узнаете об историях, которые стоят за дизайнами кроссовок.`,
    },
  ];

  return (
    <div className={rootClasses.join(' ')}>
      <div className={classes.myModalNavigation__overlay} onClick={handleClick} />
      <div className={classes.myModalNavigation__line} style={{ marginTop: 93 }} />
      <div className={classes.myModalNavigation__title}>КАТЕГОРИИ</div>
      <div className={classes.myModalNavigation__line} style={{ marginBottom: 15 }} />

      {menuItems.map((item, index) => (
        <div
          key={index}
          className={`${classes.myModalNavigation__link}${activeMenu === index ? ' ' + classes.open : ''}`}
          onClick={() => toggleMenu(index)}
          style={item.color ? { color: item.color } : null}
        >
          {item.label}
        </div>
      ))}

      <div className={classes.myModalNavigation__line} style={{ marginTop: 10 }} />
      <div className={classes.myModalNavigation__title}>О НАС</div>
      <div className={classes.myModalNavigation__line} style={{ marginBottom: 15 }} />

      {accordionItems.map((item, index) => (
        <ul key={index}>
          <li
            className={`${classes.myModalNavigation__link}${activeMenu === index ? ' ' + classes.open : ''}`}
            onClick={() => toggleMenu(index)}
          >
            {item.label}
          </li>
          <li className={`${classes.myModalNavigation__content}${activeMenu === index ? ' ' + classes.open : ''}`}>
            <br />
            {item.content}
            <br /><br />
          </li>
        </ul>
      ))}

      <div className={classes.myModalNavigation__line} />
      <div className={classes.myModalNavigation__logo}>
        <img src={logo} alt="logo" />
      </div>
    </div>
  );
};

export default MyModalNavigation;
